import React from "react";
import { Switch, Route, Link } from "react-router-dom";
import { ItemListContainer } from "../components/views/ItemListContainer/ItemListContainer";
import { ItemDetailContainer } from "../components/views/ItemDetailContainer/ItemDetailContainer";
import { CartItems } from "../components/views/cart/CartItems";

export const Router = () => {
  return (
    <Switch>
      {/* Inicio */}
      <Route exact path="/" component={ItemListContainer} />

      {/* Marcas */}
      <Route exact path="/category/:categoryId" component={ItemListContainer} />

      {/* Detalle producto */}
      <Route exact path="/item/:itemId" component={ItemDetailContainer} />

      {/* Carrito con items */}
      <Route exact path="/cart" component={CartItems} />

      {/* Página no encontrada */}
      <Route path="/">
        <h2>Error, página no encontrada</h2>
        <Link to="/">Volver al inicio</Link>
      </Route>
    </Switch>
  );
};

export default Router;
